import React, { Component } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import './App.css';
import HEADER from "./components/header/header"
import INFO from "./components/info/info"

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Switch>
            <Route>
              <HEADER></HEADER>
              <h1>TEST</h1>
            </Route>
            <Route path="/info">
              <HEADER></HEADER>
              <INFO></INFO>
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
